import React from "react";

export const Footer = () => {
    return (
        <div>
            <footer className="bg-gray-800 text-white py-4 px-4 font-pop">
                <div className="text-2xl font-bold">OLINA </div>
                <div className="text-xl">Como sube y baja</div>
                <div className="display">
                    <div className="text-lg">Teléfono</div>
                    <div className="text-lg">Correo Electrónico</div>
                </div>
            </footer>
        </div>
    );
};
